/*Table structure for table `t_room` */

DROP TABLE IF EXISTS `t_room`;

CREATE TABLE `t_room` (
  `room_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '房间id',
  `building_id` bigint(20) DEFAULT NULL COMMENT '楼栋编号id(楼栋标识)',
  `room_name` varchar(20) DEFAULT NULL COMMENT '房间名称',
  `room_status` int(1) DEFAULT NULL COMMENT '房间状态(全部、1空置、0已租、2即将到期：10天内)',
  `room_type` int(1) DEFAULT NULL COMMENT '户型(1一室、2一室一厅、3两室一厅、4三室一厅、5四室一厅、6其它',
  `room_area` int(3) DEFAULT NULL COMMENT '房间面积',
  `room_price` decimal(10,0) DEFAULT NULL COMMENT '房间价格',
  `pay_way` int(1) DEFAULT NULL COMMENT '结算方式(押一付三、押一付一、自定义：文字输入)',
  `room_orther` varchar(50) DEFAULT NULL COMMENT '配套：动态添加如热水器、空调等',
  `room_pic` varchar(100) DEFAULT NULL COMMENT '房间图片',
  `map_pic` varchar(100) DEFAULT NULL COMMENT '周边地图截图',
  `contract_id` varchar(50) DEFAULT NULL COMMENT '合同Id',
  `room_msg` varchar(50) DEFAULT NULL COMMENT '房间简介',
  `remark` varchar(50) DEFAULT NULL COMMENT '备注',
  `create_by` varchar(15) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(15) DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` int(1) DEFAULT '0' COMMENT '删除标志（0代表存在 1代表删除）',
  PRIMARY KEY (`room_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

/*Data for the table `t_room` */

