/*Table structure for table `t_tenant` */

DROP TABLE IF EXISTS `t_tenant`;

CREATE TABLE `t_tenant` (
  `tenant_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '租户ID',
  `tenant_name` varchar(25) DEFAULT NULL COMMENT '租户姓名',
  `tenant_acount` varchar(25) DEFAULT NULL COMMENT '租户账号',
  `password` varchar(64) DEFAULT NULL COMMENT '密码',
  `credentials_type` int(1) DEFAULT NULL COMMENT '证件类型(0身份证、1港澳证、2居住证、3军官证、4护照、5其它)',
  `credentials_code` varchar(30) DEFAULT NULL COMMENT '证件号',
  `tenant_pic` varchar(100) DEFAULT NULL COMMENT '租户头像',
  `phone` varchar(11) DEFAULT NULL COMMENT '联系电话',
  `contract_id` bigint(20) DEFAULT NULL COMMENT '合同编号',
  `status` int(1) DEFAULT NULL COMMENT '状态(0正常、2延期缴费、3已退租)',
  `credit` varchar(10) DEFAULT NULL COMMENT '信用额度',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`tenant_id`)
