/*Table structure for table `t_village` */

DROP TABLE IF EXISTS `t_village`;

CREATE TABLE `t_village` (
  `village_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '小区编号id(小区标识)',
  `village_name` varchar(30) DEFAULT NULL COMMENT '小区名称',
  `village_address` varchar(100) DEFAULT NULL COMMENT '所在市/区、小区地址',
  `village_type` int(1) DEFAULT NULL COMMENT '小区类型(0集中式、1分散式、2其它)',
  `building_num` int(5) DEFAULT NULL COMMENT '楼栋数量',
  `room_num` int(5) DEFAULT NULL COMMENT '房间数量',
  `charge` varchar(15) DEFAULT NULL COMMENT '负责人',
  `charge_phone` varchar(11) DEFAULT NULL COMMENT '负责人电话',
  `jw` varchar(50) DEFAULT NULL COMMENT '经度、纬度',
  `charge_pic` varchar(100) DEFAULT NULL COMMENT '负责人头像',
  `village_pic` varchar(100) DEFAULT NULL COMMENT '小区图片(一张2M以下)',
  `village_orther` varchar(100) DEFAULT NULL COMMENT '小区配套：动态添加10个以内，如XX医院、学校等(以逗号隔开)',
  `village_msg` varchar(250) DEFAULT NULL COMMENT '小区简介：250字节以内',
